import './App.css';
import FunList from './FunList/index';
import Test from './Test/Test';

function App() {

  let number = 0;
  const plus = () => {
    number = number+1;
    console.log(number);
    document.querySelector('h2').innerText = number;
  }
  const minus = () => {
    number = number-1;
    console.log(number);
    document.querySelector('h2').innerText = number;
  }

  return (
    <div className="App">
      <h1 className='logo'>Fun</h1>
      <FunList/>
      <Test />
      <div className='count-box'>
        <h2>{number}</h2>
        <button onClick={plus}>증가</button>
        <button onClick={minus}>감소</button>
      </div>
    </div>
  );
}

export default App;
